import React from "react";
import ProjectComponent from "../components/ProjectComponent";

function CurrentProjects() {
  return (
    <div className="bg-green-100 mx-10 flex flex-wrap bg-white h-auto items-center justify-evenly">
      <ProjectComponent
        title="project 1"
        text="Body of project 1. My name is daniel blah b"
      ></ProjectComponent>
      <ProjectComponent
        title="project 1"
        text="Body of project 2. My name is daniel blah b"
      ></ProjectComponent>
      <ProjectComponent
        title="project 1"
        text="Body of project 3. My name is daniel blah b"
      ></ProjectComponent>
    </div>
  );
}

export default CurrentProjects;
